(129, 'Swakelola anggaran Refungsionalisasi Sungai/Kali dan PHB di Wilayah Kota Administratif Jakarta Barat TA 2013.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Perkara dugaan tindak pidana korupsi swakelola anggaran Refungsionalisasi Sungai/Kali dan PHB di Wilayah Kota Administratif Jakarta Barat Tahun Anggaran 2013.', NULL, NULL, NULL, NULL, '2017-09-05', '2017-09-05', NULL, 3, 3, 1, 0, 0, '2017-09-05 07:23:34', '2017-09-05 07:33:38'),
(130, 'Penyalahgunaan wewenang (PNS) melakukan pungutan liar terkait penanganan perkara TPK, Kabupaten Sumenep.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Perkara dugaan tindak pidana korupsi penyalahgunaan wewenang yang dilakukan oleh Pegawai Negeri Sipil (PNS) dengan melakukan pungutan liar atau menerima sejumlah uang terkait penanganan perkara tindak pidana korupsi pada Kabupaten Sumenep.', NULL, NULL, NULL, NULL, '2017-09-05', '2017-09-05', NULL, 3, 3, 1, 0, 0, '2017-09-05 07:40:13', '2017-09-08 08:33:07'),
(131, 'Percobaan memberitahukan perbuatan pidana korupsi yang tidak benar', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'TAHAP II \r\nTGL. 08.12.2016', 'perkara yang diduga keras melakukan TPK percobaan memberitahukan perbuatan pidana korupsi yang tidak benar, melanggar Pasal 15 jo  Pasal 23, UU No.31 Tahun 1999 tentang Pemberantasan Tindak Pidana Korupsi jo UU No. 20 Tahun 2001 tentang Perubahan atas UU Nomor 31 Tahun 1999 tentang Pemberantasan Tindak Pidana Korupsi.', NULL, NULL, NULL, NULL, '2017-09-05', '2017-09-05', NULL, 3, 3, 1, 0, 0, '2017-09-05 08:04:29', '2017-09-05 08:10:05'),
(132, 'Pengelolaan keuangan pada PT. Pertamina (Persero) Marketing Operation Regional (MOR) VI di Balikpapan TA 2012 sampai dengan 2015', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Perkara dugaan tindak pidana korupsi dalam pengelolaan keuangan pada PT. Pertamina (Persero) Marketing Operation Regional (MOR) VI di Balikpapan Tahun Anggaran 2012 sampai dengan 2015.', NULL, NULL, NULL, NULL, '2017-09-05', '2017-09-05', NULL, 3, 3, 3, 3, 1, '2017-09-05 08:21:46', '2017-09-08 07:41:48'),
(133, '(Edited) Neque porro quisquam est qui dolorem ipsum quia dolor sit amet', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Contrary to popular belief, Lorem Ipsum is not simply random text. It has roots in a piece of classical Latin literature from 45 BC, making it over 2000 years old. Richard McClintock, a Latin professor at Hampden-Sydney College in Virginia, looked up one of the more obscure Latin words, consectetur, from a Lorem Ipsum passage, and going through the cites of the word in classical literature, discovered the undoubtable source. Lorem Ipsum comes from sections 1.10.32 and 1.10.33 of \"de Finibus Bonorum et Malorum\" (The Extremes of Good and Evil) by Cicero, written in 45 BC. This book is a treatise on the theory of ethics, very popular during the Renaissance. The first line of Lorem Ipsum, \"Lorem ipsum dolor sit amet..\", comes from a line in section 1.10.32.', NULL, NULL, NULL, NULL, '2017-09-20', '2017-09-20', NULL, 3, 4, 0, 0, 0, '2017-09-20 01:33:49', '2017-09-20 01:43:21'),
(134, 'PENEGAKAN HUKUM.', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Dugaan tpk pembangunan infrastrukutur pemukuman kumuh kawasan pintu batu dirjen pkp2b prop bengkulu', NULL, NULL, 'Forum silaturahmi kerukunan masy serawai', '04/fskms/IX/2017', '2017-09-25', '2017-09-25', NULL, 1, 0, 0, 0, 0, '2017-09-25 07:59:54', '2017-09-25 08:00:37'),
(135, 'LAPOARAN DUGAAN PERBUATAN MELAWAN HUKUM', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 'Pemberian  imb  di desa cibatu kab bekasi', NULL, NULL, 'Rakyat Indonesia Berdaya', '175/LP-DPP/F-RIB/IX/2017', '2017-09-18', '2017-09-25', NULL, 1, 0, 0, 0, 0, '2017-09-25 08:10:26', '2017-09-25 08:10:26'),
